import React, { Component } from 'react'
import { HeaderWarpper, Headercenter, Headercity, Headerright,Header_a,Headerreg} from './style'

class Header extends Component {

  render() {
    return (
      <HeaderWarpper>
        <Headercenter>
          <Headercity>广东</Headercity>
          <Headerright><Header_a>你好，请登录</Header_a>  <Headerreg>免费注册</Headerreg>
          <Header_a> 我的订单</Header_a>
          <Header_a> 我的京东</Header_a>
          <Header_a> 京东会员</Header_a>
          <Header_a> 企业采购</Header_a>
          <Header_a> 客户服务</Header_a>
          <Header_a> 网站导航</Header_a>
          <Header_a> 手机京东</Header_a>
            </Headerright>
        </Headercenter>
      </HeaderWarpper>
    )
  }
}

export default Header;
